    days60 = document.getElementById("60days");

lineChart.addEventListener("click", function () {
    chartType = 'line';
    createChart(chartType, chartDays);
}, false);

barChart.addEventListener("click", function () {
    chartType = 'bar';
    createChart(chartType, chartDays);
}, false);

